import React from 'react';

function Home() {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>Welcome to the Book Recommendation App</h1>
            <p>Discover your next favorite book!</p>
        </div>
    );
}

export default Home;
